Dzień dobrym, mam do sprzedania samochód osobowy marki Seat Ibiza wyprodukowany w 2003 roku, który został wyposażony w silnik benzynowy o pojemności 1390 cm3, legitymujący się mocą 75 KM, który pokonał do tej pory 142000 km. Samochód pod względem mechanicznym w dobrym stanie, silnik odpala bez problemów ciepły czy zimny, skrzynia biegów pracuje bez zarzutu, zawieszenie pracuje prawidłowo, cicho wybiera nierówności, układ kierowniczy jest precyzyjny. Wizualnie Ibiza prezentuje się jak na zdjęciach dodam, że pojazd jest używany i posiada normalne ślady wynikające z wieku i eksploatacji. Wnętrze pojazdu prezentuje się dobrze, jest czyste i zadbane.



Seat jest wyposażenia w:

- Elektryczne szyby przednie i tylne;

- Centralny zamek;

- 2 x airbag;

- Radio CD z USB;

I wiele innych rzeczy o których zapomniałem wspomnieć.



Zapraszam wszystkie zainteresowane osoby do kontaktu telefonicznego w celu uzyskania większej ilości informacji. 



Samochód do obejrzenia w Łodzi po wcześniejszym umówieniu się.



OC ważne do 25.07.2025 roku.

Przegląd techniczny 05.06.2026 roku.

